It might be worth factoring the line for converting julianDate to a common function, since it seems to be repeated', 'comment_created': datetime.datetime(2021, 8, 23, 6, 52, 57, tzinfo=datetime.timezone.utc), 'commenter': 'albertchae', 'type': 'User'}, {'comment_id': 693707673, 'comment_body': "Actually since this structure is so common, I wonder if you could do something like

```
  function convertGregorianDateToTarget(value, targetCalendar) {
       var julianDate = $.calendars.instance('gregorian').parseDate('yyyy/mm/dd', value).toJD();
       var targetDate = $.calendars.instance(targetCalendar).fromJD(julianDate)
       return targetDate.formatDate('yyyy/mm/dd');
  }
  ```
  
  then you could do something like `convertGregorianDateToTarget(value, 'ethiopian')`? 
  
